andmehoive_protsess:
Andmete andmekogusse kandmisel lähtub vastutav töötleja toimingute tegemise kohta õigusaktides sätestatud tähtaegadest. Andmed kantakse andmekogusse järgmiste dokumentide alusel:
1) välisriigi esinduse noot või organisatsiooni või institutsiooni ametlik kiri;
2) diplomaadi- ja teenistuskaardi taotlus;
3) diplomaadi- ja teenistuskaardi lisataotlus;
4) diplomaadi- ja teenistuskaardi taotleja passi koopia;
5) mootorsõiduki  registreerimistunnistuse koopia.
Välisministeeriumile esitab andmed välisriigi esindus, rahvusvaheline organisatsioon, rahvusvahelise organisatsiooni või rahvusvahelise kokkuleppega loodud institutsioon, kes taotleb toimingu tegemist. 
Andmete esitaja vastutab alusdokumentidel olevate andmete õigsuse eest. Andmekogusse kantavate ja sealt väljastatavate andmete vastavuse eest Välisministeeriumile esitatud andmetele vastutab vastutav töötleja oma pädevuse piires.

kirjeldus:
Õppeasutuse juhi käskkirjaga selleks volitatud töötajad.

Iga tudengi kohta esitatakse:
* Õppuri isikukood, perekonnanimi, eesnimi, kodakondsus ( ei ole kohustuslik);
* Õppeasutusse õppima asumise kuupäev; 
* Õppeasutusest lahkumise kuupäev; 
* Lahkumise põhjuse kood; 
* Kursus; 
* Õppeasutuse registreerimisnumber, õppeasutuse nimi; 
* Õppekava kood; 
* Õppekava järgne nominaalne õppeaeg;
* Õppekeel, õppevorm; 
* Finantseerija, õppelaenuõiguslikkus; 
* Haridus sisseastumisel; 
* Eelmise kooli lõpetamise aasta; 
* Eelmise kooli välismaal lõpetamise tunnus

