Laod : 
1.lao asukoht ja telefon; 
2.lao omanik ja telefon; 
3.laos olev varustus ja kogused;

Andmeid raudteede riiklikusse registrisse esitatavad raudteede omanik või valdaja. Raudteede registreerimise aluseks olevad dokumendid on:
1.kirjalik registreerimisavaldus; 
2.dokumendid raudtee omandiõiguse, otse valduse, raudtee teemajanduse rajatiste ja seadmete (tehnilised passid, rööbasteede pikiprofiilide ja jaamade mõõtkavalised ja skemaatilised plaanid jm) ja raudtee kuulumisel raudteeinfrastruktuuri hulka sellevastavuse kohta kehtestatud nõuetele; 
3.raudtee geograafilist asukohta tähistav kaardimaterjal; 
4.riigilõivu tasumist tõendavad dokumendid.

eesmark:
Registri pidamise eesmärk on järgmiste isikute ja nende tegevuse kohta andmete kogumine ja süstematiseerimine, et võimaldada nende tegevuse üle arvestuse pidamist jaametliku kontrolli teostamist: 
1) toiduseaduse alusel tegevusloa saanud või majandustegevusteate esitanud toidu käitlejad ning toiduseaduse § 7 lõike 1 punktis 2 nimetatud ettevõtjad;
2) söödaseaduse alusel tegevusloa saanud või majandustegevusteate esitanud sööda käitlejad.

I ja II astme kohtute statistika ja lahendite andmekogu asutatakse:
1) avalikkuse, kohtute ja teiste riigiasutuste operatiivseks varustamiseks kohtustatistilise informatsiooniga;
2) jõustunud kohtuotsuste avalikustamiseks «Avaliku teabe seaduse» (RT I 2000, 92, 597) nõuetest lähtuvalt;
3) kohtute varustamiseks kohtu töö juhtimiseks vajaliku statistilise informatsiooniga;
4) Justiitsministeeriumi ja teiste riigiasutuste varustamiseks kohtusüsteemi haldamiseks ning õigusloomeks vajaliku statistilise informatsiooniga;
5) kohtupraktika ühtlustamise eelduste loomiseks.

andmehoive_protsess:
Andmeid kogutakse järgmistel viisidel:
1. Ettevõtja täidab ja esitab taotluse elektrooniliselt ettevõtja töökeskkonnas, ametnik vaatab taotluse üle ning avalikustab andmed. Andmed on kättesaadavad avaliku teenuse kaudu.
2. Ettevõtja täidab elektrooniliselt ja edastab digiallkirjastatud taotluse ametnikule. Ametnik vaatab taotluse üle, kannab andmed registrisse ametniku töökeskkonna kaudu. Andmed on kättesaadavad avaliku teenuse kaudu.
3. Ettevõtja täidab taotluse paberil ja toob ise kohale või edastab postiga ametnikule. Ametnik vaatab taotluse üle, kannab andmed registrisse ametniku töökeskkonna kaudu. Andmed on kättesaadavad avaliku teenuse kaudu.
Taotluse ettevõtja poolt esitamise ja ametniku poolt registrisse kandmise ajal teostatakse päringuid (X-tee vahendusel) järgmistesse andmekogudesse:
-	Äriregister – ettevõtja andmed ja seotud isikud;
-	Kutseregister – isiku kehtivad kutsetunnistused;
-	Karistusregister – isiku kehtivad karistused;
-	Tehnilise järelevalve amet – ettevõtja kehtivad ettekirjutused.

Alates 01.07.2014 rakenduva tarkvara puhul logivad kasutajad MTRi läbi eesti.ee teabevärava. Andmete sisestamiseks on eesti.ee-s loodud vastavad X-Forms vormid, mille kaudu andmed edastatakse MTRi.

