andmehoive_protsess:
Kaitseväekohustuslaste üle arvestuse pidamiseks on registri rakenduses kasutatud loogikat, et iga isiku kohta on digitaalne isikukaart, millel on kajastatud kõik isiku kohta kogutavad andmed ning info temaga seotud dokumentide ja tehtud toimingute kohta. Lisaks on registri rakendusse sisse ehitatud mitmed protsessiloogikad kaitseväeteenistuse korraldamiseks ja andmetega opereerimiseks, mis valdavalt on realiseeritud projektipõhiselt (näiteks ajateenitusse kutsumine on üks projekt).
Registri andmehõive toimub liidestuste teel teiste andmekogudega ning Kaitseressursside Ametile esitatud dokumentide ja andmefailide alusel.

Register on liidestatud järgmiste andmekogudega:  
•Eesti rahvastikuregister - isikuandmed (isikukood, eesnimi, perekonnanimi, isanimi, sugu, sünniaeg, sünnikoht, alaealiste laste arv, perekonnaseis, kodakondsus, aadressandmed)  ja isikut  identifitseerivad dokumendid ; 
•Eesti hariduse infosüsteem – haridusdokumendid;
•Liiklusregister - Eestis väljastatud juhilubade andmed; 
•Kaitseväe personaliarvestuse süsteem - kaitseväeteenistusalaseid andmed (staatus, lisastaatus, kõlblikkus, auaste ja selle omistamise kuupäev, teenistusaeg ning vande andmise kuupäev);
•Karistusregister – kaitseväekohustuslaste karistusandmed;
•Kaitseväe ja Kaitseministeeriumi arstlikud komisjonid – kaitseväekohustuslaste kõlblikkuse määramisega seotud  arstlike komisjonide otsused ja diagnoosid;
•Mobilisatsiooni riiklik keskregister -  andmed paigutuse kohta sõjaajal;

Andmete esitajateks on:
•Kaitseväe väljaõppekeskused – andmed ajateenistuse alustamise ja lõpetamise kohta;
•Valitsusasutused ja institutsioonid, mille koosseisu kuuluvatel ametikohtadel töötavate isikute mobiliseerimisele rakendatakse piirangut - isikute mobiliseerimisele piirangute kehtestamisega seotud andmed;
•Kriminaalmenetlusregister ja Kohtute infosüsteem – kaitseväekohustuslase kriminaalmenetluslikud andmed;
•Riiklikust pensionikindlustuse register  – andmed kaitseväekohustuslaste puuete kohta;
•Kaitseressursside Amet – ametis koostatud dokumendid ning andmed kaitseväekohustuslastega seotud toimingute kohta;
•Kaitseväekohustuslased – esitatud dokumendid ( Kaitseväeteenistuse seaduses sätestatud andmed);

