kirjeldus:
Õppeasutused, koolitusloa taotlejad. Õppekava registreerimiseks esitatakse andmed ühtse vormi alusel, kus on kirjas:  
1. õppeasutus; (õppeasutuse õppeasutus); (teaduskond);  
2. õppekava nimetus eesti keeles,  
3. õppekava nimetus inglise keeles;  
4. tase;  
5. maht ainepunktides;  
6. nominaalne õppeaeg;  
7. andmed õppekava akrediteerimise kohta;  
8. vastuvõtu tingimused;  
9. õppekava eesmärgid;  
10. õppekava ja õppetöö korralduse lühikirjeldus;  
11. lõpetamise tingimused; 
Registreerimiskomisjon lisab õppekava koodi. 

Koolitusloa saamiseks esitatakse järgmised andmed: 
1. asutus; (asutuse asutus);  
2. omanik,  
3. asutuse kood;  
4. taotluse esitamise kuupäev;  
5. õppekava (kursuse) nimetus;  
6. õppekava tase, kui on tasemehariduse õppekava;  
7. maht;  
8. eesmärgid;  
9. õppekava ja õppetöö korralduse lühikirjeldus;  
10. paberkandjal mitmesuguseid lisadokumente, mis olenevad õppeasutuse tüübist (nt. erakooli asutamisleping, kooli arengukava, õppejõudude kirjalikud nõusolekud kooli tööle asumiseks, kooli ruumide plaanid, vastavus tervisekaitsenõuetele, õppemateriaalse baasi kirjeldus, põhikiri, Maksuameti tõend maksuvõlgnevuse puudumise kohta). 

Registri vastutav töötleja lisab:  
1. koolitusloa numbri,  
2. väljaandmise aja,  
3. protokolli numbri,  
4. kehtivusaja lõpu,  
5. loa väljaandmise aluseks oleva seaduse,  
6. loa andmisest keeldumis-põhjuse.

eesmark:
PRIA-le õigusaktidega pandud kohustuste täitmise tagamiseks järgmiste andmete kogumine, töötlemine ja säilitamine: 
1) «Euroopa Liidu ühise põllumajanduspoliitika rakendamise seaduse» § 2 lõikes 1 nimetatud ühise põllumajanduspoliitika turukorraldusabinõude rakendamisel antavate toetuste, põllumassiivi, tootmiskvoodi, riikliku koguse määramise, impordi- ja ekspordilitsentsi, eksporditoetuse sertifikaadi või seestöötlemise sertifikaadi, pakkumises ja turukorraldusabinõudes osalemiseks eelnevat heakskiitu taotleva isiku ja taotluse kohta;
2) «Maaelu ja põllumajandusturu korraldamise seaduse» ning «Struktuuritoetuse seaduse» alusel PRIA antavat toetust taotleva isiku ja taotluse kohta;

ulesanne:
Riigieksamite infosüsteemiga korraldatakse:
1) eksamiülesannete koostamist, eeltestimist, eeltesti analüüsimist ja ülesannete dokumenteerimist ja säilitamist;
2) eksamitööde koostamist, dokumenteerimist ja arhiveerimist;
3) eksamite tehnilist korraldamist, sh eksamitele registreerimist ja eksamitunnistuste arvestust;
4) eksamitööde hindamist ja dokumenteerimist.

Põhiülesanded on andmete registreerimine, töötlemine ja muude registritoimingute tegemine.
(1) Andmekogu pidamine toimub vastavalt põhimäärusele, Avaliku teabe seadusele ja muudele õigusaktidele.
(2) Andmekogu peetakse ühetasandilise infotehnoloogilise andmebaasina.
(3) Andmekogu koosseisu kuuluvad:
1) paigaldiste andmebaas;
2) toodete andmebaas;
3) tegevuste andmebaas;
4) juriidiliste isikute andmebaas;
5) füüsiliste isikute andmebaas;
6) füüsilistele isikutele väljastatud pädevustunnistuste andmebaas;
7) tehniliste kontrollide andmebaas;
8) riikliku järelevalve menetluste andmebaas.

Alkoholiseadus
§ 8. Riikliku alkoholiregistri toimimise üldalused
(1) Riikliku alkoholiregistri (käesolevas jaos edaspidi alkoholiregister) pidamise põhiülesanded on:
1) käesolevas seaduses sätestatud juhtudel alkoholi kandmine alkoholiregistrisse (registrikande tegemine);
2) alkoholiregistrisse kantud alkoholi käsitleva teabe töötlemine;
3) alkoholiregistris säilitamiseks võetud tootenäidiste hoidmine;
4) järelevalve teostamisel võetud alkohoolse joogi tootenäidise võrdlemine alkoholiregistris säilitatava tootenäidise või muu materjaliga.

eesmark:
E-toimiku süsteemi eesmärk on: 
1) tagada ülevaade uurimisasutuste, prokuratuuri ja kohtute menetluses olevatest kriminaalasjadest, samuti alustamata jäetud kriminaalasjadest;
2) tagada ülevaade kohtuvälise menetleja ja kohtu menetluses olevatest väärteoasjadest, samuti alustamata jäetud väärteomenetlustest;
3) kajastada andmeid kriminaal- ja väärteomenetluse käigus tehtud toimingute kohta;
4) võimaldada menetleja töö korraldamist;
5) tagada kriminaal- ja karistuspoliitiliste otsustuste tegemiseks vajaliku statistika kogumine;
6) võimaldada andmete ja dokumentide elektroonilist edastamist. 
E-toimiku süsteemi avaliku liidese pidamise eesmärk on: 
1) võimaldada seaduses ja käesolevas määruses sätestatud juhtudel ja mahus isikule juurdepääs e-toimiku süsteemile ning selles sisalduvatele andmetele tema kohta; 
2) võimaldada isikul esitada süütegusid menetlevatele asutustele elektrooniliselt taotlusi ja dokumente.

andmehoive_protsess:
E-toimiku süsteemi peetakse ühetasandilise elektroonilise andmekoguna. E-toimiku süsteemi kantakse andmeid ja e-toimiku süsteemi kantud andmeid kasutatakse andmevahetuskihi X-tee kaudu. E-toimiku süsteemi pidamisel kasutatakse automatiseeritud andmetöötlust ja e-toimiku süsteemi andmed säilitatakse digitaalsel kujul. E-toimiku süsteem saab andmevahetuskihi X-tee kaudu andmeid teistest andmekogudest süütegusid menetlevate asutuste tegevust reguleerivates seadustes sätestatud ülesannete täitmiseks vastavalt kokkuleppele nende andmekogude vastutavate töötlejatega. 
E-toimiku süsteemi esitavad andmeid süütegude menetlejad, menetlusosalised ja teised menetluses osalevad isikud. E-toimiku süsteemi esitatakse andmed kas e-toimiku süsteemi liidese või e-toimiku süsteemiga liidestatud teise andmekogu kaudu (edaspidi koos nimetatud põhisüsteem). 
E-toimiku süsteemi liidesed on:
1) avalik liides;
2) kriminaalmenetluse liides;
3) väärteomenetluse liides. 
E-toimiku süsteemiga liidestatud teised andmekogud on:
1) kohtute infosüsteem;
2) infosüsteem POLIS;
3) muu kohtuvälise menetleja andmekogu, milles töödeldakse ja mille kaudu esitatakse e-toimiku süsteemi väärteomenetluse andmeid.

ADS-i keskne tehnoloogiline lahendus on ADS-i infosüsteem (varasem nimi oli haldussüsteem), mis sisaldab:
1) kõikide aadressiobjektide kohta järgmisi andmeid – kohanimesid, koha-aadresse, liike, aadressipunktide koordinaate, aadressiandmete kehtivuse algus- ja lõpuaegu, aadressiandmete õigusliku aluse infot, aadressiobjektide oleku infot, koha-aadressi oleku infot, ruumiaadresse, ruumikujusid ja ruumikujudega seotud metaandmeid, algset ehk peamist koopiat normaliseeritud koha-aadressidest ning mitteametlikke aadressiandmeid;
2) kõikide EHAK-i objektide ja aadressikohtade kohta järgmisi andmeid – kohanimesid, liike, ruumikujusid, aadressipunktide koordinaate ja ruumikujudega seotud metaandmeid. 
ADS-i infosüsteemile esitavad andmeid:
1) Maa-amet katastriüksuste kohta;
2) Majandus- ja Kommunikatsiooniministeerium hoonete ja hooneosade kohta;
3) Siseministeerium kohanimede kohta;
4) kohaliku omavalitsuse üksused koha-aadresside määramise, muutmise ja kehtetuks tunnistamise kohta.
(2) Vabariigi Valitsus võib käesoleva seaduse § 58 lõikes 1 sätestatud aadressiandmete süsteemi kehtestava määrusega ADS-i infosüsteemile andmete esitajate ringi laiendada. 
ADS-i infosüsteemi vastutav töötleja teeb järgmisi tegevusi:
1) tagab infosüsteemi toimimise ning pärast ADS-i käivitamise hetke üksnes korrektsete koha-aadresside esitamise võimaluse ADS-i haldussüsteemi;
2) tagab EHAK-i objektide ja aadressikohtade kohanimede, liikide, aadressipunktide ruumikujude ja ruumikujudega seotud metaandmete hoidmise ja väljastamise;
3) tagab aadressiobjektide koha-aadresside, liikide, ruumiaadresside, ruumikujude, aadressipunktide ja ruumikujudega seotud metaandmete hoidmise ja koha-aadresside väljastamise normaliseeritud kujul;
4) peab aadressiobjektide liikide klassifikaatorit;
5) teeb aadressiandmete ja aadressiobjektide ruumiandmete analüüsitöid ning loob koha-aadresside ja aadressiobjektide vahel seosed;
6) toodab aadressiobjektide ruumiaadresse;
7) tuvastab ebakorrektselt määratud aadressid ning teavitab nendest vastavat aadressiandmete vastutavat töötlejat ja koha-aadressi määrajat;
8) tuvastab EHAK-i objektide ja aadressikohtade andmete muudatustest tulenevate koha-aadresside muudatuste vajadused ning teavitab nendest vastavat aadressiandmete vastutavat töötlejat ja koha-aadressi määrajat;
9) pakub koha-aadressi määrajale ja aadressiandmete vastutavale töötlejale suunatud aadressiteenuseid koha-aadresside määramiseks ja töötlemiseks ning koha-aadressi määrajale ja aadressiandmete töötlejale suunatud teenuseid aadressiandmete kasutamiseks;
10) tagab ADS-i haldussüsteemi käivitamise hetkest ajalooliste aadresside seoste kättesaadavuse.

kirjeldus:
Andmeandjateks on avalikud arhiivid, riigi- ja kohaliku omavalitsuse asutused, juriidilised ja füüsilised isikud, kes valdavad avalikke arhivaale ning riigiarhivaari otsusega registrisse kantud eraarhivaalide valdajad.

Arhiivi ja/või arhiivi koostisosade kohta kantakse registrisse järgmised andmed:
1. tähis (arhiiviviit);
2. nimetus (pealkiri)
3. piirdaatumid;
4. arhiiviväärtusega arhiivi osa piirdaatumid;
5. kogus;
6. arhiiviväärtusega arhiivi osa kogus;
7. märge juurdepääsupiirangu kohta;
8. riigiarhivaari otsuse number ja kuupäev (eraarhivaalide puhul).

Arhiivimoodustaja kohta kantakse registrisse järgmised andmed:
1. nimevormid kronoloogilises järjekorras;
2. nimevormi kehtimisaeg.

Arhivaalide omaniku kohta kantakse registrisse järgmised andmed:
1. nimi;
2. kontaktandmed.

Arhivaalide valdaja ja asukoha kohta kantakse registrisse järgmised andmed:
1. nimi;
2. kontaktandmed;
3. arhivaalidele juurdepääsu korraldava asutuse või selle struktuuriüksuse või isiku nimi ja kontaktandmed, kui need erinevad valdaja andmetest.

eesmark:
Kohtute infosüsteem (KIS) on õigusemõistmise elektrooniline töökeskkond, mille asutamise eesmärk on:
1) koondada kohtuasjad ühtsesse andmekogusse;
2) töödelda menetlustoimingute andmeid;
3) töödelda elektroonilisi menetlusdokumente;
4) võimaldada kohtuasja andmete automatiseeritud kasutamist menetlusdokumentide ja statistiliste aruannete koostamisel;
5) tagada pidev ülevaade kohtumenetluste käigust;
6) võimaldada kohtute töökoormuse, lahendite analüüsi ja kohtumenetluste statistiliste ülevaadete tegemist;
7) võimaldada kohtulahendite sisulist analüüsimist ja süstematiseerimist märksõnastiku, annotatsioonide ja otsingumootori abil;
8) võimaldada elektrooniliste menetlusdokumentide esitamist ja säilitamist;
9) teha kohtulahendid arvutivõrgus avalikkusele kättesaadavaks.

E-toimiku süsteemi põhiinfosüsteemina on KIS-i peamine eesmärk vahendada kasutajatele e-toimiku süsteemi teenuseid tagades sellega menetluste efektiivne läbiviimine.

kirjeldus:
Maakatastriseaduse kohaselt on:
Maakataster (kataster) - andmekogu, mis koosneb maaregistrist koos katastrikaartidega ja katastriarhiivist; 

Katastri kaardid - katastri koosseisu kuuluvad kaardid registrisse kantava informatsiooni (piiride, kitsendusi põhjustavate objektide paiknemise, maa kvaliteedi andmete jne) graafiliseks esitamiseks. Kaartideks on katastrikaart (§ 11), kitsenduste kaart (§ 12) ning maa kvaliteedi ja hindamise kaart (§ 14);

andmehoive_protsess:
Registrisse andmete esitajad on:
1) riigimaanteede osas Maanteeamet;
2) kohalike ja erateede osas kohalikud omavalitsused;
3) metsateede osas riigimetsa majandamist korraldav isik või riigiasutus. 
 Teede registrisse kandmise aluseks olevad dokumendid (edaspidi alusdokument) on:
1) riigimaanteede nimekiri;
2) kohalike teede nimekiri;
3) metsateede nimekiri;
4) avalikuks kasutuseks määratud erateede nimekiri;
5) avalikuks kasutuseks määramata erateede nimekiri. 
Eelpool nimetatud teid iseloomustavate andmete registrisse kandmise aluseks on tee-ehitus- ja teekasutusluba, teehoiutööde käigus ja järelevalve teostamisel koostatud dokumendid ning teised tee andmeid sisaldavad dokumendid.

kirjeldus:
Kiirgustegevusloa saanud isik

Registrikaardile kantakse järgmised andmed: 
1) kiirgustöötaja ees- ja perekonnanimi; 
2) isikukood; 
3) tööandja registrikood, nimi ja aadress; 
4) kiirgustöötaja ametikoht; 
5) kiirgustöö nimetus (kood); 
6) kiirgustööle asumise aeg; 
7) märge kiirgustöötaja atesteerimise kohta (tunnistuse registreerimisnumber ja kuupäev); 
8) hindamisperioodi alg- ja lõpukuupäevad; 
9) doosi hindamise kuupäev; 
10) väljaspool keha asuvast kiirgusallikast põhjustatud efektiivdoosi suurus;
11) radionukliidide sissehingamisest või sissesöömisest tekitatud sisekiiritusest hindamisperioodi vältel saadud efektiivdoosi suurus või vajadusel ekvivalentdoosi suurus kiirgustöötaja silmaläätses, nahas või jäsemetes;
12) avarii või avarii tagajärgede likvideerimisel saadud efektiivdoosi suurus; 
13) summaarne kutsekiirituse doosi suurus hindamisperioodi jooksul ja kasvavalt.

Registrisse kantakse proviisorite ja farmatseutide kohta järgmised andmed:
1) eesnimi;
2) perekonnanimi;
3) kodakondsus(ed);
4) eelmine (eelmised) ees- ja perekonnanimi(-nimed);
5) isikukood;
6) kutse nimetus;
7) rahvusvahelise ühtse hariduse liigituse kood ISCED 1997;
8) kvalifikatsiooni tõendava dokumendi nimetus eesti ja dokumendi väljastanud riigi keeles;
9) kvalifikatsiooni tõendava dokumendi väljastanud õppeasutuse nimi;
10) kvalifikatsiooni tõendava dokumendi seeria ja number ;
11) kvalifikatsiooni tõendava dokumendi väljastamise kuupäev;
12) kvalifikatsiooni tõendava dokumendi väljastanud riik;
13) varasem kutsekvalifikatsiooni tunnustamine Euroopa Majanduspiirkonna liikmesriigi (liikmesriikide) poolt (kui on varem tunnustatud);
14) õppeasutusse immatrikuleerimise aasta;
15) töökoht (kui on olemas), asutuse nimi ja registrinumber;
16) ametikoht rahvusvahelise ametite klassifikaatori ISCO-88 järgi (kui on olemas);
17) proviisori või farmatseudi kontaktandmed (aadress, telefon, faks, e-post);
18) Tervishoiuameti otsus proviisorina või farmatseudina registreerimise kohta või kohtuotsus, millega on isikult ära võetud kvalifikatsiooni tõendavas dokumendis ja registreerimistõendis märgitud kutsealal tegutsemise õigus;
19) Tervishoiuameti otsus registreerimise kehtetuks tunnistamise kohta;
20) registreerimistõendi number. 
Tervishoiuameti infosüsteem on Proviisorite ja farmatseutide registrile üleminfosüsteemiks.

eesmark:
Tallinna maaregistri pidamise eesmärkideks on:
1) arvestuse pidamine Tallinna haldusterritooriumil asuvate maaüksuste, kohanimede ja lähiaadresside üle;
2) arvestuse pidamine maaüksuste, kohanimede ja lähiaadresside kohta;
3) andmete esitamine linna teistele registritele ja riigi registritele maaüksuste, kohanimede ja lähiaadresside kohta;
4) maaüksuste, kohanimede ja lähiaadresside menetlemise tulemuslikum korraldamine läbi menetluskäigu optimaalseks ja jälgitavaks muutmise;
5) arvestuse pidamine Tallinna haldusterritooriumil asuvate maamaksuga maksustatava maa, maksuvaba maa ning maksusoodustustega maa maakasutuste üle;
6) arvestuse pidamine maatüki maksustamishinna arvutamiseks vajalike andmete üle;
7) arvestuse pidamine maamaksu subjektide ja nende maksusoodustuste üle;
8) maksuhaldurile maksustamishinna ja maksusoodustuse andmete esitamine;
9) õigustatud isikutele maamaksu ja maksustamishinna kohta andmete esitamine.

andmehoive_protsess:
Tallinna maaregistrisse kogutakse andmeid järgmistel alusel:
1) füüsilise või juriidilise isiku avaldus;
2) maamõõtja poolt koostatud krundi plaan;
3) füüsilise või juriidilise isiku suhtes antud haldusakt;
4) teistest riigi- ja kohaliku omavalitsuse andmekogudest saadavad andmed ( kinnistusraamat, maksukohustuslase register, riigi- ja kohaliku omavalitsuse asutuste riiklik register, Eesti rahvastikuregister, äriregister, maakataster);
5) maamaksuseaduses määratletud maamaksu objektid.
 Infosüsteemi saavad kasutada andmete sisestamiseks ja muutmiseks vastutav töötleja, vastutava töötleja õiguste teostaja ja volitatud töötleja.

ulesanne:
Andmekogu kasutatakse:
 1) Tööinspektsiooni järelevalvetegevuse planeerimiseks, operatiivseks juhtimiseks ja ülesannete täitmiseks;
