 3) töötervishoiu-, tööohutus- ja töösuhtealase tegevusega seotud ametkondade koostööks;
 4) töötervishoiu-, tööohutus- ja töösuhetealaseks ennetustööks, ohtlike tegevusalade ning töö- ja ametikohtade väljaselgitamiseks.

andmehoive_protsess:
1) töötaja töövaidlusasja algatamisel või Tööinspektsioonile teate saatmisel; 
2) tööandja töötervishoiu ja tööohutuse seaduse, töölepingu seaduse ning individuaalse töövaidluse lahendamise seaduse alusel;
