kirjeldus:
Eesti Vabariigi territooriumil kiirgusallikaid omavad ja valdavad füüsilised ja juriidilised isikud.

Andmekogusse kantakse järgmised andmed:
1. kiirgusallikat omava isiku nimi ja aadress;
2. ettevõtte nimi ja aadress;
3. kiirgustegevuse liik (meditsiinidiagnostika ja -teraapia, lahtiste kiirgusallikate kasutamine tuumameditsiinis, tööstusradiograafia, kiirguse kasutamine tootmises, teaduslik uurimistöö, veterinaaria jt.), milleks kiirgusallikat kasutatakse;
4. kiirgusallika tüüp;
5. kiirgusallika tootja;
6. kiirgusallika valmistamise aasta;
7. kiirguse liik;
8. radionukliide sisaldavat kiirgusallikat iseloomustavad näitajad:
-radionukliid ja selle aktiivsus (Bq)
-radionukliidi keemiline vorm; suletud või lahtine kiirgusallikas;
9. elektrilist kiirgusseadet iseloomustavad näitajad:
-tööpinge, kiirguse maksimaalne energia KeV);
-voolutugevus;
10. isik, kes tegi kanded registrisse ja kuupäev

