Andmekogus peetakse koondarvestust Eesti Vabariigi arengu- ja humanitaarabi tegevuste ja nende kulude üle.
Andmekogusse sisestavad andmeid tegevusi rahastanud:
1)	riigisasutus või selle hallatav asutus;
2)	kohaliku omavalitsuse asutus või selle hallatav asutus; 
3)	muu avalik-õiguslik juriidiline isik;
Välisministeerium kontrollib andmekogusse sisestatud andmed hiljemalt 14 kalendripäeva jooksul peale andmete esitamist ja teeb otsuse andmete aktsepteerimise või mitteaktsepteerimise kohta. 
Välisministeeriumile esitatud andmete õigsuse eest vastutab andmeandja. Andmete muutumise korral viib andmeandja vajalikud muudatused andmebaasi sisse. Kui Välisministeerium avastab ebaõiged või puudulikud andmed, teeb ta andmeandjale järelepärimise. Välisministeerium avalikustab andmed projektide kohta oma veebilehel.
Andmekogu võimaldab esitada aruandeid Majandusliku Koostöö ja Arengu Organisatsiooni (Organisation for Economic Co-operation and Development, OECD) arengukoostöö komitee (Development Assistance Committee, DAC) ametliku arenguabi statistika jaoks.

