SA - saatmisosakonna ametnik (spetsialist-planeerijad ning osakonna juhataja) – koostab aktsepteeritud tellimuste põhjal marsruudid koos aegadega saatmise lähte– ja sihtkohas ning saadetavate nimekirjad. Need lisatakse koostatud saatmisplaanile;

KA - kohtus ametnik, kes vormistab tellimusi – esitab tellimusi kinnipeetavate saatmiseks kohtusse, näeb reaalajas tellimise täitmist, vajadusel muudab või tühistab tellimusi

