Kinnistusraamat on maakohtute juures peetav register, kus registreeritakse kinnisasjad ja kinnisasjadega seotud õigused. 
Andmed kinnistu kohta: 

Registriosa esimene jagu:
1.kinnistu katastritunnus; 
2.kinnistu sihtotstarve;
3.kinnistu asukoht; 
4.kinnistu kasuks seatud piiratud asjaõigused;
5.kinnistu pindala; 
6.kinnistuste ühendamine ja jagamine, samuti kinnistu osa liitmine ja kinnistu osa eraldamine.

Registriosa teine jagu :
1.kinnistu omaniku nimi; 
2.kui kinnistu on ühises omandis - omanike nimed, see, kas kinnistu on ühis- või kaasomandis ning kaasomandi korral kaasomanike osade suurus; 
3.kande õiguslik alus. 

Registriosa kolmas jagu:
1.kinnistut koormavad piiratud asjaõigused, välja arvatud hüpoteek, kinnisomandi kitsendused ja märked nende kohta; 
2.kinnistu omaniku käsutusõiguse kitsendused, samuti muud märked omandi kohta; 
3.kannete muudatused, sealhulgas puudutatud isikute kitsendused oma õiguste käsutamisel. 

Registriosa neljas jagu:
1.hüpoteegipidaja;
2.hüpoteegi rahaline suurus (hüpoteegi summa); 
3.intressimäärad; 
4.muude kõrvalnõuete rahaline suurus;
5.märked hüpoteegi kohta; 
6.kannete muudatused, sealhulgas puudutatud isikute kitsendused oma õiguste käsutamisel; 
7.kannete kustutamine.

