Andmekogu asutamise peamised eesmärgid:
	koondada Tallinna linna ametiasutuste (edaspidi ametiasutused) tellitud või teostatud ja kavandatavad uuringud ühtsesse andmekogusse, saada ülevaade uuringutest ning säilitada uuringute andmed korrastatud kujul;
	parandada uuringute kättesaadavust ametiasutustele ja avalikkusele;
	vältida topeltuuringute tegemist Tallinna omavalitsusüksuses;
	aidata kaasa Tallinna linna rahvusvahelisele ning kõrgkoolide ja teadusasutustega ning teiste kohalike omavalitsustega uuringute valdkonnas tehtavale koostööle ja andmevahetusele.

andmehoive_protsess:
Kõik linna ametiasutused sisestavad andmekogusse andmeid või edastavad andmed sisestamiseks Tallinna Linnakantselei arenguteenistuse linnauuringute osakonnale. Andmed kavandatava uuringu kohta kantakse andmekogusse 10 tööpäeva jooksul alates uuringu tegemise otsustamisest. Andmed kavandatava uuringu kohta on nähtavad üksnes ametiasutustele. Andmed valmis uuringu kohta sisestatakse 10 tööpäeva jooksul alates ajast, kui uuring on lõplikult valmis. Andmed valmis uuringu kohta on nähtavad nii ametiasutustele kui avalikkusele, v.a andmed uuringu maksumuse ja finantseerimisallika kohta ning asutusesiseseks kasutamiseks määratud uuringute andmed, mis on nähtavad üksnes ametiasutusele. Teave maksumuse ja finantseerimisallika kohta avaldatakse avalikkusele passiivselt, s.t info antakse, kui seda küsitakse. 

Andmekogusse sisestatud andmete õigsuse eest vastutab andmete sisestaja. Andmekogu pidamise koordineerimise ja järelevalve eest vastutab Tallinna Linnakantselei arenguteenistuse linnauuringute osakond. 
Andmekogu on avalikkusele kättesaadav Tallinna veebilehe kaudu ning ametiasutustele nii Tallinna veebilehe kui ka Intraneti (Tallinna linna sisevõrgu) kaudu. Avalikkusele ei kuvata uuringute tekste, mis on seadusest lähtuvalt määratud asutusesiseseks kasutamiseks.

Andmekogul on neli kasutajataset:
1)	avalik kasutaja: näeb andmekogus kõikide teostatud uuringute andmeid, välja arvatud asutusesiseseks kasutamiseks määratud uuringute andmed; 
2)	ametiasutuse kasutaja: näeb andmekogus nii teostatud kui ka kavandatavate uuringute andmeid, välja arvatud asutusesiseseks kasutamiseks määratud uuringute andmed;
3)	ametiasutuse andmete sisestaja: sisestab ja saab muuta oma ametiasutuse uuringute andmeid, näeb andmekogus oma ametiasutuse kõikide uuringute täielikke ning teiste ametiasutuste kõikide teostatud ja kavandatavate uuringute andmeid, välja arvatud asutusesiseseks kasutamiseks määratud uuringute andmed; 
4)	peakasutaja ehk administraator: näeb ja saab muuta kõikide uuringute andmeid.

