ulesanne:
Tagada andmeandjatele andmete esitamise ja uuendamise võimalused; kasutada riigi infosüsteemi kuuluvate teiste andmekogude põhiandmeid ning tagada andmekogu põhiandmete kasutatavus lepingulistele partneritele; võimaldada treenerikutset omistaval organil täita kutse andja ülesandeid. Andmete kogumise, koondamise, ristkasutamise, uuendamise, sorteerimise, avalikustamise ja muu töötlemisega luua terviklik spordialane andmekogum, mis on abiks spordijuhtidele, -organisatsioonidele ja avalikkusele.

(1) Spordiorganisatsioonide alamandmekogu ülesanne on:
1) hallata ülevaadet Eesti spordisüsteemi aluseks olevate spordiorganisatsioonide struktuuri ehk maakonna spordiliitude, spordialaliitude, spordiühenduste ja rahvusliku olümpiakomitee liikmeskonna kohta;
2) koguda, süstematiseerida ja avaldada informatsiooni spordiorganisatsioonide tegutsemise, spordi harrastamise, treeneriametis tegutsevate isikute, sportimiseks kasutatavate spordiobjektide ja ehitiste, personali ja majandamise kohta; 
3) koondada iga spordiorganisatsiooni juurde temaga seotud terviklik spordialane andmekogum, mis on abiks Eesti spordijuhtidele ja -töötajatele nende töös ning avalikkusele;
4) avaldada ohutu ja teadlikuma sportimise eesmärgil spordiorganisatsioonides treeneriametis tegutsevate isikute nimed koos kutsekvalifikatsiooni andmetega ja spordiala või distsipliini nimetusega, millel ta tegutseb;
5) koguda ja edastada andmed Statistikaametile riikliku spordistatistika tootmiseks.  

(2) Spordikoolide alamandmekogu ülesanne on:
1) koguda, süstematiseerida ja avaldada informatsiooni spordikoolide, nende spordiga seotud õppekavade, huvihariduse omandamise raames toimuva spordi harrastamise ning treeneriametis tegutsevate isikute kohta;
2) avaldada ohutu ja teadlikuma sportimise eesmärgil spordikoolides treeneriametis tegutsevate isikute nimed koos kutsekvalifikatsiooni andmetega ja spordiala või distsipliini nimetusega, millel ta tegutseb.

(3) Spordiehitiste alamandmekogu ülesanne on hallata ülevaadet, koguda, süstematiseerida ja avaldada teavet avalikkusele suunatud spordiobjektide, nende spordialase teeninduse, sportimispaikade tehniliste andmete ja sportimisvõimaluste kohta.

(4) Treenerite alamandmekogu ülesanne on:
1) võimaldada treenerikutse andjatel “Kutseseaduses” sätestatud treenerikutse andmisega seotud ülesannete täitmist, sh andmevahetust kutseregistriga;
2) treenerikutsega seotud koolitusvajaduste prognoosimise ning sporditegevuses osalejate ohutuse eesmärgil treenerikutset omavate ja taotlevate isikute ning spordiklubides, spordialaliitudes ja spordikoolides treenerite ning treeneriametis tegutsevate kutseta isikute treeneriametiga seotud tegevuse andmete kogumine, süstematiseerimine, haldamine ja avaldamine;
3) treenerite, treenerikutset omavate, treenerikutset taotlevate ja treeneriametis tegutsevate kutseta isikute kontaktandmete haldamine ning neile operatiivse asjakohase treenerikutsega seotud spordiinfo saatmine.

E-õigusesse kantud dokumendid on avalikud. Infosüsteemis on kättesaadav kogu informatsioon, mis
puudutab kogu eelnõu elutsüklit:
1) väljatöötamise kavatsuse kooskõlastamine Justiitsministeeriumiga;
2) eelnõu esitamine ministeeriumidele kooskõlastamiseks;
3) eelnõu esitamine Justiitsministeeriumile kooskõlastamiseks;
4) Vabariigi Valitsuse istungile esitamine.

