andmehoive_protsess:
Andmekogu vastutav töötleja:
1) korraldab andmekogu tööd;
2) sisestab andmekogusse andmeid isikutele maksuvabastuse andmise kohta;
3) sisestab andmekogusse andmeid isikule maksusoodustuste andmise kohta;
4) sisestab andmekogusse andmeid määratud viivistasu otsuste ja nende peale esitatud vaiete, vaidele lisatud dokumentide ja vaidemenetluses tehtud otsuste kohta;
5) edastab määratud viivistasu otsuse kolmanda eksemplari sõiduki omanikule või vastutavale kasutajale;
6) edastab tähtajaks tasumata viivistasu otsused sundtäitmiseks kohtutäiturite ja pankrotihalduri kojale;
7) sisestab andmekogusse andmed mootorsõidukiga Tallinna vanalinnas jalakäijate alale juurdepääsu õiguse kohta;
8) sisestab andmekogusse andmed liikumispuudega või pimedat inimest teenindava sõiduki parkimiskaardi kehtivuse kohta;
9) annab volitatud töötlejale juurdepääsu andmekogule ja õiguse andmete sisestamiseks;
10) kontrollib volitatud töötleja poolt andmekogu kasutamist, andmete sisestamist ja sisestatud andmete õigust;
11) annab volitatud töötlejale juhiseid andmekogu põhimäärusest tulenevate ülesannete täitmiseks;
12) teostab järelevalvet andmekogusse tehtud päringute ja nende põhjendatuse üle;
13) vastutab andmekogu pidamise seaduslikkuse üle;
14) täidab muid õigusaktidest tulenevaid ülesandeid andmekogu pidamisel.

Andmekogu volitatud töötleja:
1) sisestab andmekogusse andmeid määratud viivistasu otsuste ja viivistasu otsuste peale esitatud vaideid;
2) kasutab andmekogu üksnes volitatud töötlejaga sõlmitud halduslepinguga või hankelepinguga määratud ülesannete täitmiseks;
3) teavitab viivitamata vastutavat töötlejat andmekogusse kantud ebaõigetest andmetest, andmete mittesihipärasest kasutamisest ja andmekogu kasutamisel tekkinud tehnilistest probleemidest;
4) vastutab tema poolt sisestatud andmete õigsuse eest;
5) osaleb andmekogu arendustöödel ja arenduste juurutamisel;
6) täidab vastutava töötleja seaduslikke korraldusi andmekogu kasutamisel.

