Andmekogu eesmärgid:
•	parendada taotlemise, menetlemise ja otsustamise protsesse reklaami- või teabe eksponeerimiseks Tallinna linnale kuuluva ehitise pinna kasutusse andmisel või välireklaami- või teabekandja kooskõlastamisel eramaal;
•	toetada reklaami ja teabe eksponeerimise menetlemisega seotud tööprotsesse ning koondab tegevuste käigus kogutavad ja loodavad andmed ühtsesse andmekogusse;
•      muuta andmete haldamise tsentraalseks, tagades kasutajatele aktuaalsete andmete kättesaadavuse;
•	tõhustada linna ametiasutuste sisest ja vahelist valdkondlikku infovahetust ning aruandlusprotsesse. Võimaldada standardsete andmevahetusprotokollide abil vahetada andmekogu andmeid teiste Tallinna linna ning riigi andmekogudega;
•	luua linnakodanikke teenindav infoportaal, kus operatiivselt ja täpselt avalikustatakse kõik linnaruumi paigaldatud reklaami- ja teabekandjad ning nende olulised andmed;
•	süstematiseerida ja parendada reklaami- ja teabe eksponeerimiseks ehitise pinna kasutusse andmise ning reklaamimaksu haldamisega seotud andmete kogumist, pidamist ja analüüsimist;
•	süstematiseerida ja tõhustada reklaami- ja teabe eksponeerimisega seonduvaid järelevalvelisi protsesse, luua elektroonsed võimalused isikute teavitamiseks esinevatest puudustest sellel alal.

